import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {

    return(
        <div>
            <br></br>

            <br></br>
            <table width="240px;" border="0" align="center" cellpadding="0" cellspacing="0">            
            <tr>
                <td align="center">            
                        <NavLink to="./Patient">
                            <button type="button" class="btn btn-primary btn-lg">Patient</button>
                        </NavLink></td>
                <td align="center">           
                        <NavLink to="./Clinician">
                            <button type="button" class="btn btn-primary btn-lg">Clinician</button>
                        </NavLink> </td>
            </tr>
            </table>
        </div>

    );

};

export default Home;
